 @wagnermartins9484  rapaz igual no jogo palmeiras 4x0 São Paulo 
O goleiro toda hora se jogava no chão demorava bater tiro de meta, os laterais ficava 30 segundos pra bater lateral 
E tomou 1 gol fez mais cera e tomou mais 2 gols aí 3x0 começou a reclamar e tomou mais 1 e corriam pra bater lateral e o goleiro parou de cair kkkk e o juiz nada fez e o São Paulo não podia reclamar de tempo pq eles fizeram cera desde primeiro minutos
